package org.example.string;

import org.example.Verify;

import java.util.*;

public class ValidAnagram {

    public boolean sort (String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        char[] cs = s.toCharArray();
        char[] ts = t.toCharArray();
        Arrays.sort(cs);
        Arrays.sort(ts);
        s = new String(cs);
        t = new String(ts);
        return s.equals(t);
    }

    public boolean myFirstIdea(String s, String t) {
        Map<Character, Integer> cntDict1 = new HashMap<>();
        Map<Character, Integer> cntDict2 = new HashMap<>();
        if(s.length() != t.length()) {
            return false;
        }

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if(!cntDict1.containsKey(c)) {
                cntDict1.put(c, 1);
            } else {
                cntDict1.put(c, cntDict1.get(c) + 1);
            }
            c = t.charAt(i);
            if(!cntDict2.containsKey(c)) {
                cntDict2.put(c, 1);
            } else {
                cntDict2.put(c, cntDict2.get(c) + 1);
            }
        }

        for (Character c: cntDict2.keySet()) {
            if (!cntDict2.get(c).equals(cntDict1.get(c))) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        ValidAnagram v = new ValidAnagram();
        Verify.print(v.sort("anagram", "nagaram"), true);
        Verify.print(v.sort("rat", "car"), false);
        Verify.print(v.sort("ab", "a"), false);
        Verify.print(v.sort("a", "ab"), false);
        Verify.print(v.sort("aacc", "ccac"), false);
        Verify.print(v.sort("",
                ""),
                true);

    }

}
